DROP TABLE incidents;
CREATE TABLE incidents(
   Incident_ID          INTEGER  NOT NULL PRIMARY KEY 
  ,Customer_ID          INTEGER  NOT NULL
  ,Age                  INTEGER  NOT NULL
  ,Gender               VARCHAR(6) NOT NULL
  ,Season               VARCHAR(6) NOT NULL
  ,Weather              VARCHAR(5) NOT NULL
  ,Activity             VARCHAR(15) NOT NULL
  ,Slope_Name           VARCHAR(13) NOT NULL
  ,Slope_Difficulty     VARCHAR(12) NOT NULL
  ,Skill_Level          VARCHAR(12) NOT NULL
  ,Protective_Gear      VARCHAR(6) NOT NULL
  ,Injuries             VARCHAR(11) NOT NULL
  ,Injury_Severity      INTEGER  NOT NULL
  ,Response_Time        INTEGER  NOT NULL
  ,Hospital_Transport   VARCHAR(3) NOT NULL
  ,Hospital_Stay_Length INTEGER  NOT NULL
);
